import React from 'react';

function Event(props) {
  return (
  	<div className="card-box">
      <div className="events-card-img">
        <img src="https://images.unsplash.com/photo-1517463859029-c01164a5505a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=3300&q=80"></img>
      </div>
      <div className="events-card-header">
        <p>{props.content}</p>
      </div>
      <div className="events-card-content">
        <p>{props.content}</p>
      </div>
    </div>
  );
}

export default Event;
